# the goal is to predict house prices

# load packages
library(tidyverse)
library(tidymodels)
library(naniar)

# read data
train <- read.csv("/Users/samuelwong/Desktop/Work/Data/kaggle/house prices/train.csv"); nrow(train) # 1460
test <- read.csv("/Users/samuelwong/Desktop/Work/Data/kaggle/house prices/test.csv"); nrow(1459) # 2919

# create SalePrice in the test set
test$SalePrice <- 0

# combine both train and test sets into one dataframe
full <- rbind(train, test); nrow(full) # 2919

glimpse(full)

